import styled from "styled-components";

const SectionContainer = styled.section`
            background: '#F2F2F2';
            border: '2px solid #0B7373';
            borderRadius: '16px';
            position: 'absolute';
            width: '1412px';
            height: '500px';
            left: '254px';
            top: '1176px';
`;

export {SectionContainer};
